import { io } from "socket.io-client";

const ConnectionURI = "http://192.168.9.228:8080";

export function connect() {
  const socket = io(ConnectionURI);

  socket.emit("new-user-connet", "Naval");

  socket.on("chat message", (m) => console.log(m));
}
